¿Qué alimentos podemos comer para calmar la ansiedad? Muchos de vosotros me comentáis que normalmente lo que os hace comer más de la cuenta es la ansiedad. Así que hoy os traigo los alimentos que podéis comer para calmarla .
– Gelatinas sin azúcar o gelatinas light: como son agua en casi un 100%, nos ayudará a mantenernos hidratados y sentirnos algo saciados sin aportar muchas calorías.
– Almendras. Son una gran fuente de vitamina E, magnesio, fibra, proteína y grasas saludables. Cuando sintáis que estáis nerviosos u os falte energía, os ayudarán a quitaros el hambre.
– Yogur griego. Nos reduce la presión arterial y nos aporta vitaminas B6 y B12. Además, es rico en magnesio, calcio, potasio y proteínas, que nos ayudan a calmar la ansiedad muy rápido.
– Avena. Es una gran fuente de vitaminas del complejo B, magnesio y fibra. Estos tres componentes son muy importantes para reducir la ansiedad. La ansiedad surge cuando la serotonina, la hormona antidepresiva, baja. Lo que hace la avena es estimular esta hormona.
– Plátano. El plátano ayuda a producir serotonina y es capaz de reducir los síntomas de ansiedad. ¡Así que ya sabéis! A comer plátanos cuando tengáis ansiedad.
– Vegetales crudos. Los vegetales crudos son bajos en calorías y altos en fibra, por lo que nos ayudarán a saciar. Podéis apostar por zanahorias o pepino.
¡Espero que esté listado de alimentos que nos ayudan a reducir la ansiedad os haya servido de ayuda!⠀⠀⠀
